from PIL import Image
import re


def load(inp, dest):
  inp = eval(inp.replace(";", "").replace("{", "[").replace("}", "]"))
  rows = 14
  cols = len(inp)//rows
  inp = [((y&(255<<16))>>16, (y&(255<<8))>>8, y&255) for x in range(rows) for y in (inp[x*cols:x*cols+cols][::-1] if x%2==1 else inp[x*cols:x*cols+cols])]

  im = Image.new('RGB', (cols, rows))
  im.putdata(inp)
  im.save(dest)
  

